import React , { Component } from 'react';
import { BrowserRouter, Route, Link } from "react-router-dom";

const Home = (props) => {


    function handleSubmit(health, maxHealth, attack, speed, maxSpeed, armor, coins) {
        props.pickClass(health, maxHealth, attack, speed, maxSpeed, armor, coins)
    }

        return(
            <div>
                <nav>
                    <h1>This is the homepage</h1>
                    <h1>Intro and story go here.</h1>
                    <h5>Pick Your Class</h5>
                    <h5>playerHealth is {props.playerHealth} </h5>
                    <button className="pickClass" onClick={() => handleSubmit(100, 100, 4, 5, 5, 1, 2)}>Warrior</button>
                    <button className="pickClass" onClick={() => handleSubmit(150, 150, 2, 4, 4, 3, 2)}>Tank</button>
                    <button className="pickClass" onClick={() => handleSubmit(25, 25, 10, 4, 4, 0, 2)}>Glass Cannon</button>
                    <ul>
                        <li>
                            <Link to="/GameBoard">Go To Room One</Link>
                        </li>
                    </ul>
                </nav>
            </div>
        )
}

export default Home;
